import { configureStore } from "@reduxjs/toolkit";
import authReducer from "./Auth";
import hostReducer from "./Host";
const ApplicationStore = configureStore({
  reducer: {
    auth: authReducer,
    host: hostReducer,
  },
});
export default ApplicationStore;
